--
-- Table structure for table `t_conf_factor`
--

DROP TABLE IF EXISTS `t_conf_factor`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_conf_factor` (
  `FACTOR_ID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '因子id FACTOR_ID',
  `FIELD_ID` bigint(20) DEFAULT NULL COMMENT '属性ID',
  `TOPIC_CODE` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '主题CODE',
  `PROD_LINE_CODE` char(2) COLLATE utf8_bin DEFAULT NULL COMMENT '产品线代码',
  `FACTOR_LABEL` varchar(200) COLLATE utf8_bin NOT NULL COMMENT '因子标签',
  `FACTOR_NAME` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '因子名称，将来作为字段名称',
  `DATA_TYPE` char(5) COLLATE utf8_bin DEFAULT NULL COMMENT '数据类型',
  `DATA_LENGTH` int(11) DEFAULT NULL COMMENT '数据长度',
  `DATA_PRECISION` int(11) DEFAULT NULL COMMENT '数据精度',
  `DATA_FORMAT` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '数据格式',
  `DATA_CHECKER` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '数据格式校验(el表达式)',
  `CREATED_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `UPDATE_BY` bigint(20) DEFAULT NULL COMMENT '更新记录人',
  `UPDATE_TIME` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新记录时间',
  PRIMARY KEY (`FACTOR_ID`),
  KEY `FK_CONF_FACTOR__PROD_LINE` (`PROD_LINE_CODE`),
  KEY `FK_CONF_FACTOR__TOPIC` (`TOPIC_CODE`),
  KEY `FK_DOMAIN_FACTOR__DOMAIN_OBJ_FIELD` (`FIELD_ID`),
  CONSTRAINT `FK_CONF_FACTOR__PROD_LINE` FOREIGN KEY (`PROD_LINE_CODE`) REFERENCES `t_product_line` (`PROD_LINE_CODE`),
  CONSTRAINT `FK_CONF_FACTOR__TOPIC` FOREIGN KEY (`TOPIC_CODE`) REFERENCES `t_conf_topic` (`TOPIC_CODE`),
  CONSTRAINT `FK_DOMAIN_FACTOR__DOMAIN_OBJ_FIELD` FOREIGN KEY (`FIELD_ID`) REFERENCES `t_conf_domain_object_field` (`FIELD_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='公共因子定义';
