DROP TABLE IF EXISTS `t_conf_formula`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_conf_formula` (
  `FORMULA_ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '公式ID',
  `TOPIC_CODE` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '主题CODE',
  `PROD_LINE_CODE` char(2) COLLATE utf8_bin DEFAULT NULL COMMENT '产品线代码',
  `FORMULA_CODE` varchar(40) COLLATE utf8_bin DEFAULT NULL COMMENT '公式编号',
  `FORMULA_NAME` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '公式名称',
  `FORMULA_METHOD_NAME` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '对应的方法名称',
  `FORMULA_DSL` varchar(6000) COLLATE utf8_bin DEFAULT NULL COMMENT '公式描述DSL',
  `LOCKED` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否锁定',
  `FORMULA_BODY` varchar(6000) COLLATE utf8_bin DEFAULT NULL COMMENT '公式体',
  `SPECIAL_FORMULA_YN` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否定制化公式',
  `TESTED_YN` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否已测试',
  `LAST_UPDATE_ID` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '最近更新人',
  `LAST_UPDATE_TIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '最近更新时间',
  PRIMARY KEY (`FORMULA_ID`),
  KEY `FK_CONF_FRML__PROD_LINE` (`PROD_LINE_CODE`),
  KEY `FK_FORMULA__TOPIC` (`TOPIC_CODE`),
  CONSTRAINT `FK_CONF_FRML__PROD_LINE` FOREIGN KEY (`PROD_LINE_CODE`) REFERENCES `t_product_line` (`PROD_LINE_CODE`),
  CONSTRAINT `FK_FORMULA__TOPIC` FOREIGN KEY (`TOPIC_CODE`) REFERENCES `t_conf_topic` (`TOPIC_CODE`)
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='计算公式表';
/*!40101 SET character_set_client = @saved_cs_client */;

