单位保险金额','N','\ndef rateTableName = ctx.getProduct().getBasic().getFormula(ctx.getTopicCode()).getRateTableByAlias(\"RATE_PROD_PREM_BY_AMOUNT\");\n		def coverPeriodType = ctx.getPolicy().getCoverage().getCoverPeriodType();\n		def coveragePeriod = ctx.getPolicy().getCoverage().getCoveragePeriod();\n		def insuredAge = ctx.getPolicy().getInsured().calcAgeAndDay(ctx.getPolicy().getEffectiveDate());\n		def rate1 = RatetableHelper.getRate(ctx.getProductId(),rateTableName,coverPeriodType,coveragePeriod,insuredAge);\n		def amount = ctx.getPolicy().getCoverage().getSumAssured();\n		def saunit = ctx.getProduct().getPrem().getDefaultLiability().getLiabParam(\"saUnit\");\n		return Divide.divide(Multiply.multiply(rate1,amount),saunit).setScale(2, BigDecimal.ROUND_HALF_UP);\n','N','N','400','2016-05-11 21:45:09'),(71,'PREM_CAL','LF','PROD_STD_PREM_BF__F4','按单位保额的保费计算4','PREM_CAL_PROD_STD_PREM_BF__F4','保额保费费率表（按职业类别） × 保额 / 单位保险金额\n','N','\ndef rateTableName = ctx.getProduct().getBasic().getFormula(ctx.getTopicCode()).getRateTableByAlias(\"RATE_PROD_PREM_BY_AMOUNT_4\");\ndef coverPeriodType = ctx.getPolicy().getCoverage().getCoverPeriodType();\ndef coveragePeriod = ctx.getPolicy().getCoverage().getCoveragePeriod();\ndef jobRiskCate = ctx.getProduct().getPrem().getDefaultLiability().getLiabParam(\"jobRiskCate\");\ndef jobClass = RatetableHelper.getRate(ctx.getProductId(),\"T_UNDERWRITE_JOB\",ctx.getPolicy().getInsured().getJobCode(),jobRiskCate);\ndef rate1 = RatetableHelper.getRate(ctx.getProductId(),rateTableName,coverPeriodType,jobClass,coveragePeriod);\ndef amount = ctx.getPolicy().getCoverage().getSumAssured();\ndef saunit = ctx.getProduct().getPrem().getDefaultLiability().getLiabParam(\"saUnit\");\nreturn Divide.divide(Multiply.multiply(rate1,amount),saunit).setScale(2, BigDecimal.ROUND_HALF_UP);\n','N','N','400','2016-05-12 10:09:10'),(72,'RISK_DEATH','LF','PROD_RISK_DEATH__F1','死亡风险保额计算1','RISK_DEATH_PROD_RISK_DEATH__F1','死亡风险保额计算1','N','def amount = ctx.getPolicy().getCoverage().getSumAssured();\nreturn amount;','N','N','407','2016-05-11 16:13:41'),(73,'RISK_CRITICAL','LF','PROD_RISK_CRITICAL__F1','重疾风险保额计算1','RISK_CRITICAL_PROD_RISK_CRITICAL__F1','重疾风险保额计算1','N','def amount = ctx.getPolicy().getCoverage().getSumAssured();\nreturn amount;','N','N','400','2016-05-11 15:58:03'),(74,'RISK_ACCIDENT','LF','PROD_RISK_ACCIDENT__F1','意外风险保额计算1','RISK_ACCIDENT_PROD_RISK_ACCIDENT__F1','意外风险保额计算1','N','def amount = ctx.getPolicy().getCoverage().getSumAssured();\nreturn amount;','N','N','400','2016-05-11 15:58:42'),(75,'RISK_MEDICAL','LF','PROD_RISK_MEDICAL__F1','医疗风险保额计算1','RISK_MEDICAL_PROD_RISK_MEDICAL__F1','医疗风险保额计算1','N','def amount = ctx.getPolicy().getCoverage().getSumAssured();\nreturn amount;','N','N','400','2016-05-11 15:59:21'),(76,'PREM_CAL','LF','PROD_STD_PREM_BF__F3','按单位保额的保费计算3','PREM_CAL_PROD_STD_PREM_BF__F3','保额保费费率表（按有无社保） × 保额 / 单位保险金额','N','\ndef rateTableName = ctx.getProduct().getBasic().getFormula(ctx.getTopicCode()).getRateTableByAlias(\"RATE_PROD_PREM_BY_AMOUNT_3\");\n		def coverPeriodType = ctx.getPolicy().getCoverage().getCoverPeriodType();\n		def coveragePeriod = ctx.getPolicy().getCoverage().getCoveragePeriod();\n		def hasSocialSecurity = ctx.getPolicy().getInsured().getHasSocialSecurity();\n		def rate1 = RatetableHelper.getRate(ctx.getProductId(),rateTableName,hasSocialSecurity,coverPeriodType,coveragePeriod);\n		def amount = ctx.getPolicy().getCoverage().getSumAssured();\n		def saunit = ctx.getProduct().getPrem().getDefaultLiability().getLiabParam(\"saUnit\");\n		return Divide.divide(Multiply.multiply(rate1,amount),saunit).setScale(2, BigDecimal.ROUND_HALF_UP);\n','N','N','400','2016-05-12 10:19:00'),(77,'PREM_CAL','LF','PROD_STD_PREM_BF__F2','按单位保额的保费计算2','PREM_CAL_PROD_STD_PREM_BF__F2','保额保费费率表（通用） × 保额 / 单位保险金额','N','\ndef rateTableName = ctx.getProduct().getBasic().getFormula(ctx.getTopicCode()).getRateTableByAlias(\"RATE_PROD_PREM_BY_AMOUNT_2\");\n		def coverPeriodType = ctx.getPolicy().getCoverage().getCoverPeriodType();\n		def coveragePeriod = ctx.getPolicy().getCoverage().getCoveragePeriod();\n		def rate1 = RatetableHelper.getRate(ctx.getProductId(),rateTableName,coverPeriodType,coveragePeriod);\n		def amount = ctx.getPolicy().getCoverage().getSumAssured();\n		def saunit = ctx.getProduct().getPrem().getDefaultLiability().getLiabParam(\"saUnit\");\n		return Divide.divide(Multiply.multiply(rate1,amount),saunit).setScale(2, BigDecimal.ROUND_HALF_UP);\n','N','N','400','2016-05-12 10:19:13'),(78,'PREM_CAL','LF','PROD_STD_PREM_BF__F5','按单位保额的保费计算5','PREM_CAL_PROD_STD_PREM_BF__F5','保额保费费率（按被保人年龄+性别）× 保额 / 单位保险金额','N','def rateTableName = ctx.getProduct().getBasic().getFormula(ctx.getTopicCode()).getRateTableByAlias(\"RATE_PROD_PREM_BY_AMOUNT_5\");\n  def coverPeriodType = ctx.getPolicy().getCoverage().getCoverPeriodType();\n  def jobType = ctx.getPolicy().getInsured().getJobCode();\n  def coveragePeriod = ctx.getPolicy().getCoverage().getCoveragePeriod();\n  def rate1 = RatetableHelper.getRate(ctx.getProductId(),rateTableName,coverPeriodType,jobType,coveragePeriod);\n  def amount = ctx.getPolicy().getCoverage().getSumAssured();\n  def saunit = ctx.getProduct().getPrem().getDefaultLiability().getLiabParam(\"saUnit\");\n  return Divide.divide(Multiply.multiply(rate1,amount),saunit).setScale(2, BigDecimal.ROUND_HALF_UP);','N','N','400','2016-05-11 20:33:31');
