INSERT INTO `t_conf_rule_template` VALUES ('29167b3726f911e6a7a4286ed488cc2d','TEST1','MT','Sfasfdsaf#AF#','','AF:dfasfd',400,'2016-05-31 14:30:09','Sfasfdsaf#AF#'),('65a35adc17ec11e687e06c92bf178e06','RULE_NB','LF','被保人医疗类职业风险等级限制不能超过#医疗类职业风险最高等级#级','','医疗类职业风险最高等级:医疗类职业风险最高等级',400,'2016-05-12 10:50:36','【MKT】投保规则：被保人医疗类职业风险等级限制'),('abe001a51d9011e6b2e96c92bf178e06','RULE_UW','LF','累计风险保额不能超过#万#','累计风险保额不能超过#万#','万:100',400,'2016-05-19 15:10:03','累计风险保额'),('dd0ec8f9175a11e687e06c92bf178e06','RULE_NB','LF','投保保额不能超过#被保人所在地区的最高保额#','','被保人所在地区的最高保额:被保人所在地区的最高保额:',400,'2016-05-11 17:28:50','投保规则：最高保额限制'),('e7cab23b1c9d11e6b2e96c92bf178e06','RULE_NB','LF','被保人年龄不能超过#被保人最大年龄#岁,被保人年龄也不能小于#被保人最小年龄#岁','no-loop true\r\n    when\r\n  $context:MktEngineContext();\r\n  $result:RuleVerifyResult();\r\n  Insured(calcAgeAndDay($context.policy.effectiveDate)<#被保人最小年龄# || calcAgeAndDay($context.policy.effectiveDate)>#被保人最大年龄#) from $context.proposalPolicy.insured\r\n    then\r\n        $result.setResult(false);\r\n  $result.setVerifyMsg(\"被保人年龄不得小于#被保人最小年龄#岁，不得大于#被保人最大年龄#岁！\");\r\n  update($result);','被保人最大年龄:被保人最大年龄,被保人最小年龄:被保人最小年龄',400,'2016-05-18 10:12:17','【MKT】投保规则：被保人年龄限制'),('ff6f562d175911e687e06c92bf178e06','RULE_NB','LF','被保人年龄不能超过#被保人最大年龄#岁,被保人年龄也不能小于#被保人最小年龄#岁','no-loop true\n    when\n		$context:EngineContext();\n		$result:RuleVerifyResult();\n		$insured:Insured(calcAgeAndDay($context.policy.effectiveDate)<#被保人最小年龄# || calcAgeAndDay($context.policy.effectiveDate)>#被保人最大年龄#) from $context.policy.insuredList;\n    then\n        $result.setResult(false);\n		$result.setVerifyMsg(\"规则：\"+drools.getRule().getName()+\"校验失败！被保人年龄不得小于#被保人最小年龄#岁，不得大于#被保人最大年龄#岁！当前被保人年龄：\"+$insured.calcAgeAndDay($context.policy.effectiveDate));\n		update($result);','被保人最大年龄:被保人最大年龄,被保人最小年龄:被保人最小年龄',400,'2016-05-11 17:22:38','投保规则：被保人年龄限制');
