CREATE TABLE `t_liability` (
  `LIAB_ID` bigint(20) NOT NULL COMMENT 'Benefit ID',
  `PRODUCT_ID` bigint(20) DEFAULT NULL,
  `LIAB_CATEGORY` varchar(10) COLLATE utf8_bin NOT NULL COMMENT 'Benefit Category ID',
  `LIAB_NAME` varchar(100) COLLATE utf8_bin NOT NULL COMMENT 'Benefit Name',
  `CLAUSE` varchar(2000) COLLATE utf8_bin DEFAULT NULL COMMENT '条款  被保人在${}年内，因为车祸导致残疾，本公司赔付不超过90天的住院医疗费用，且费用不超过实际费用，最大不超过10000元。  %1% %2% %3%',
  `LIABILITY_TYPE` varchar(5) COLLATE utf8_bin DEFAULT '1' COMMENT '责任设计分类',
  PRIMARY KEY (`LIAB_ID`),
  KEY `fk_LIABILITY__product_id` (`PRODUCT_ID`),
  CONSTRAINT `fk_LIABILITY__product_id` FOREIGN KEY (`PRODUCT_ID`) REFERENCES `t_product` (`PRODUCT_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Insurance Liability Code Table';
