INSERT INTO `t_liability` VALUES (1,144,'2','门诊','责任','1'),(6100101,126,'8','意外伤害身故','被保险人遭受意外伤害，并自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致身故，本公司按#意外伤害身故保险金#元给付意外伤害身故保险金，本合同终止。\r\n如被保险人已按本合同约定领取了意外伤害伤残保险金，本公司按意外伤害身故保险金额扣减累计给付的意外伤害伤残保险金后给付意外伤害身故保险金，本合同终止。 ','1'),(6100102,126,'9','意外伤害伤残',' 被保险人遭受意外伤害，并自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致伤残，且属于《人身保险伤残评定标准（行业标准）》（中保协发〔2013〕88号）中所列的伤残条目，本公司依照该行业标准规定的评定原则进行伤残评定，并按评定结果所对应的给付比例乘以#意外伤害伤残保险金额#元给付意外伤害伤残保险金。 如被保险人自遭受意外伤害之日起180日后治疗仍未结束的，则按第180日的身体情况评定伤残程度，并据此给付意外伤害伤残保险金。 一次或累计给付的意外伤害伤残保险金达到意外伤害伤残保险金额时，本公司所承担的意外伤害伤残保险责任终止。','1'),(6100103,126,'8','汽车意外伤害身故','被保险人自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致身故，本公司按汽车意外伤害身故保险金额给付汽车意外伤害身故保险金#汽车意外伤害身故保险金#元，本合同终止。 如被保险人已按本合同约定领取了汽车意外伤害伤残保险金，本公司按汽车意外伤害身故保险金额扣减累计给付的汽车意外伤害伤残保险金后给付汽车意外伤害身故保险金，本合同终止。','1'),(6100104,126,'9','汽车意外伤害伤残','被保险人自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致伤残，且属于《人身保险伤残评定标准（行业标准）》（中保协发〔2013〕88号，详见附录）中所列的伤残条目，本公司依照该行业标准规定的评定原则进行伤残评定，并按评定结果所对应的给付比例乘以#汽车意外伤害伤残保险金额#元给付汽车意外伤害伤残保险金。 如被保险人自遭受意外伤害之日起180日后治疗仍未结束的，则按第180日的身体情况评定伤残程度，并据此给付汽车意外伤害伤残保险金。 一次或累计给付的汽车意外伤害伤残保险金达到汽车意外伤害伤残保险金额时，本公司所承担的汽车意外伤害伤残保险责任终止。','1'),(6100105,126,'8','火车意外伤害身故','被保险人自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致身故，本公司按火车意外伤害身故保险金额给付火车意外伤害身故保险金#火车意外伤害身故保险金#元，本合同终止。 如被保险人已按本合同约定领取了火车意外伤害伤残保险金，本公司按火车意外伤害身故保险金额扣减累计给付的火车意外伤害伤残保险金后给付火车意外伤害身故保险金，本合同终止。','1'),(6100106,126,'9','火车意外伤害伤残','被保险人自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致伤残，且属于《人身保险伤残评定标准（行业标准）》（中保协发〔2013〕88号，）中所列的伤残条目，本公司依照该行业标准规定的评定原则进行伤残评定，并按评定结果所对应的给付比例乘以#火车意外伤害伤残保险金额#给付火车意外伤害伤残保险金。 如被保险人自遭受意外伤害之日起180日后治疗仍未结束的，则按第180日的身体情况评定伤残程度，并据此给付火车意外伤害伤残保险金。 一次或累计给付的火车意外伤害伤残保险金达到#火车意外伤害伤残保险金额#时，本公司所承担的火车意外伤害伤残保险责任终止。','1'),(6100107,126,'8','轮船意外伤害身故','被保险人自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致身故，本公司按轮船意外伤害身故保险金额给付轮船意外伤害身故保险金#轮船意外伤害身故保险金#元，本合同终止。 如被保险人已按本合同约定领取了轮船意外伤害伤残保险金，本公司按轮船意外伤害身故保险金额扣减累计给付的轮船意外伤害伤残保险金后给付轮船意外伤害身故保险金，本合同终止。','1'),(6100108,126,'9','轮船意外伤害伤残','被保险人自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致伤残，且属于《人身保险伤残评定标准（行业标准）》（中保协发〔2013〕88号，）中所列的伤残条目，本公司依照该行业标准规定的评定原则进行伤残评定，并按评定结果所对应的给付比例乘以#轮船意外伤害伤残保险金额#给付轮船意外伤害伤残保险金。 如被保险人自遭受意外伤害之日起180日后治疗仍未结束的，则按第180日的身体情况评定伤残程度，并据此给付轮船意外伤害伤残保险金。 一次或累计给付的轮船意外伤害伤残保险金达到#轮船意外伤害伤残保险金额#时，本公司所承担的轮船意外伤害伤残保险责任终止。','1'),(6100109,126,'8','航空意外伤害身故','被保险人自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致身故，本公司按航空意外伤害身故保险金额给付航空意外伤害身故保险金#航空意外伤害身故保险金#元，本合同终止。 如被保险人已按本合同约定领取了航空意外伤害伤残保险金，本公司按航空意外伤害身故保险金额扣减累计给付的航空意外伤害伤残保险金后给付航空意外伤害身故保险金，本合同终止。','1'),(6100110,126,'9','航空意外伤害伤残','被保险人自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害导致伤残，且属于《人身保险伤残评定标准（行业标准）》（中保协发〔2013〕88号，中所列的伤残条目，本公司依照该行业标准规定的评定原则进行伤残评定，并按评定结果所对应的给付比例乘以#航空意外伤害伤残保险金额#给付航空意外伤害伤残保险金。 如被保险人自遭受意外伤害之日起180日后治疗仍未结束的，则按第180日的身体情况评定伤残程度，并据此给付航空意外伤害伤残保险金。 一次或累计给付的航空意外伤害伤残保险金达到#航空意外伤害伤残保险金额#时，本公司所承担的航空意外伤害伤残保险责任终止。 ','1'),(6100111,126,'0','意外伤害医疗保险金','被保险人遭受意外伤害，并自#意外伤害发生之日起#日内因该意外伤害在本公司认可医院（进行治疗所发生的合理医疗费用，本公司在扣除#免赔额#元后，按#赔付比例#给付意外伤害医疗保险金。 被保险人因意外伤害在本公司认可医院住院治疗，保险期间届满时仍未结束治疗的，本公司继续承担保险责任，但最长至第180日。 一次或累计给付的意外伤害医疗保险金达到#意外伤害医疗保险金额#时，本公司所承担的意外伤害医疗保险责任终止。 如被保险人所发生的本合同保险责任范围内的医疗费用，已从社会基本医疗保险（详见释义）、其他商业医疗保险保障计划或其他任何途径获得补偿或赔偿，本公司仅对剩余部分按上述约定承担保险责任。 ','1'),(6100201,127,'9','骨折保险金','被保险人于本保险合同有效期内遭受意外伤害事故，经卫生行政部门评定的二级以上（含二级）或本公司认可的医疗机构诊断，并经放射性检查（如X射线、CT等）证明符合本保险合同定义的股骨颈骨折，本公司按照约定保险金额向被保险人给付骨折保险金。给付骨折保险金后本合同终止。','1'),(6100301,129,'8','意外伤害身故','在保险期间内，被保险人遭受意外伤害事故，并自事故发生之日起#意外伤害发生之日起#日内因该事故身故的，保险人按本保险合同上所载的意外伤害保险金额给付身故保险金意外身故保险金，对该被保险人的保险责任终止。\r\n被保险人因遭受意外伤害事故且自该事故发生日起下落不明，后经人民法院宣告死亡的，保险人按保险金额给付身故保险金。但若被保险人被宣告死亡后生还的，保险金受领人应于知道或应当知道被保险人生还后30日内退还保险人给付的身故保险金。\r\n被保险人身故前保险人已给付第五条第二款约定的残疾保险金的，身故保险金应扣除已给付的保险金。','1'),(6100302,129,'9','意外伤害伤残','在保险期间内，被保险人遭受意外伤害事故，并自该事故发生之日起#意外伤害发生之日起#日内因该事故造成本保险合同所附《人身保险伤残评定标准》（简称《评定标准》）所列残疾程度之一的，保险人按《评定标准》所对应伤残等级的给付比例乘以本保险合同上所载的意外伤害保险金额给付残疾保险金意外残疾保险金。如第180日治疗仍未结束的，按当日的身体情况进行伤残评定，并据此给付残疾保险金。\r\n被保险人因同一意外伤害造成两处或两处以上伤残时，保险人根据《评定标准》规定的多处伤残评定原则给付残疾保险金。','1'),(6100401,132,'8','意外伤害身故','在保险期间内被保险人遭受意外伤害，并因该意外伤害导致其身故或残疾的，保险人依照下列约定给付保险金，且给付各项保险金之和不超过保险金额。一次或累计给付的保险金达到保险金额时，保险人对被保险人的保险责任终止。\r\n    在保险期间内被保险人遭受意外伤害，并自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害身故的，保险人按保险金额给付身故保险金。被保险人因遭受意外伤害且自该意外伤害发生日起下落不明，后经人民法院宣告死亡的，保险人按保险金额给付身故保险金。但若被保险人被宣告死亡后生还的，保险金受领人应于知道或应当知道被保险人生还后30日内退还保险人给付的身故保险金。\r\n被保险人身故前保险人已给付本条款约定的残疾保险金的，身故保险金应扣除已给付的保险金。','1'),(6100402,132,'9','意外伤害伤残','在保险期间内被保险人遭受意外伤害，并自该意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害造成本保险合同所附《人身保险伤残评定标准》（简称《评定标准》）所列伤残程度之一的，保险人按《评定标准》所对应伤残等级的给付比例乘以保险金额给付残疾保险金。如第180日治疗仍未结束的，按当日的身体情况进行伤残评定，并据此给付残疾保险金。被保险人因同一意外伤害造成两处或两处以上伤残时，保险人根据《评定标准》规定的多处伤残评定原则给付残疾保险金。被保险人如在本次意外伤害之前已有残疾，保险人按合并后的残疾程度在《评定标准》中所对应伤残等级的给付比例扣除原有残疾程度在《评定标准》中所对应伤残等级的给付比例，给付残疾保险金。','1'),(6100501,134,'8','猝死保险金','被保险人在保险期间内猝死，保险人（释义见6.2）按保险合同所载的身故保险金额给付身故保险金，同时对该被保险人的保险责任终止。','1'),(6200101,130,'0','意外伤害医疗','在本附加合同有效期内，若任何被保险人遭遇主合同约定的意外伤害事故，且自意外伤害事故发生之日起#意外伤害事故发生之日起#天内，在本附加合同约定的医院（简称“指定医院”）医院进行诊疗，保险人根据本附加合同的约定承担下列保险金给付责任：\r\n（1）被保险人支出的、符合当地社会医疗保险主管部门规定范围内的、必需且合理的医疗费用，在扣除每次#每次免赔额#元免赔额后，按#给付比例#比例给付医疗保险金意外伤害医疗保险金。\r\n（2）保险期间届满，被保险人治疗未满180日，且仍需继续门诊或住院的，保险人所负给付保险金责任的期限，自保险期满次日起计算，门诊治疗最长以15日为限，住院治疗者至出院之日止，最长以60日为限。\r\n保险人所负给付保险金的责任以保险金额为限，在保险期间内，对被保险人一次或者多次累计给付的保险金达到本附加保险合同载明的保险金额时，保险人对该被保险人的保险责任终止。\r\n本附加合同为费用补偿型保险合同，适用医疗费用补偿原则。若医疗费用可依法律及政府之规定而有所补偿，或从其它福利计划或医疗保险计划（包括但不限于社会医疗保险、公费医疗、工作单位、保险人在内的任何商业保险机构等）取得部分或全部补偿，对于符合当地社会医疗保险主管部门规定范围内的合理医疗费用，保险人仅负责补偿剩余部分，并以保险金额为限。','1'),(6200201,131,'1','住院医疗','在保险期间内，若任何被保险人因遭受意外伤害事故或在等待期#等待期#天（按照保险人相关规定续保的，续保保险期间不受等待期的限制）后因患疾病，经本附加合同释义约定的医院（简称“释义指定医院”）诊断必须住院治疗，保险人就其每次住院实际支出的符合当地社会医疗保险主管部门规定范围内的、必需且合理的住院医疗费用，在扣除当地社会基本医疗保险和其他途径已经补偿或给付部分以及本附加合同约定的免赔额后，对其余额按本附加合同约定的给付比例给付住院医疗保险金。免赔额及给付比例，由投保人在投保时与保险人协商确定并在保险单上载明。被保险人在保险期间内住院治疗，到保险期间届满仍未结束的，保险人继续承担本保险责任至住院结束之日止，最长不超过保险期间届满之日起第90日。但累计给付金额达到本附加险合同对应的保险金额时，保险人对该被保险人在本附加险合同项下的保险责任终止。若被保险人无社保：赔付社保范围内费用，扣除200元免赔额后，按照50%比例赔付；若被保险人有社保：扣除100元免赔额后，按照如下比例表给付。','1'),(6200301,133,'0','意外伤害医疗','    在本附加合同的保险期间内，被保险人遭受意外伤害事故，并在意外伤害发生之日起#意外伤害发生之日起#180日内在中华人民共和国（不包括香港、澳门及台湾地区）二级及以上医院或保险人认可的医疗机构进行治疗的，保险人按照下列约定进行赔偿：\r\n    （1）对于被保险人在每次意外伤害事故中发生的，符合当地社会基本医疗保险规定的、必需且合理的医疗费用，保险人在扣除保险合同约定的免赔额（#次免赔额#）后，按约定的给付比例（#有社保给付比例#或#无社保给付比例#）给付意外医疗保险金。免赔额和给付比例由投保人和保险人在投保时约定，并在保险合同中载明；\r\n    （2）保险人所负给付意外医疗保险金的责任以本附加保险合同项下的保险金额为限，对被保险人一次或者累计给付保险金达到本附加保险合同项下该被保险人的保险金额时，保险人对该被保险人的本附加保险合同项下的保险责任终止；\r\n（3）若被保险人可以从其它保险计划（包括农村合作医疗保险、社会基本医疗保险、工作单位、或其他任何商业保险机构等）获得医疗费用补偿，保险人对被保险人获得或可以获得补偿或赔偿后的医疗费用的余额按照本合同约定给付保险金。','1'),(6200401,135,'10','重大疾病保险金','在本合同保险期间内，被保险人在等待期#等待期#日后，经中华人民共和国（不包括香港、澳门、台湾地区）二级及以上医院或保险人（释义见6.3）认可的医疗机构确诊初次患有本合同约定的重大疾病（释义见6.4），保险人按照本保险合同载明的保险金额给付重大疾病保险金，同时本保险合同终止。\r\n被保险人在等待期内经确诊初次患有本合同约定的重大疾病，保险人不承担给付保险金的责任，但向投保人无息退还已交纳的保险费，同时本保险合同终止。\r\n若被保险人属于续保或在本保险合同有效期内因遭受意外事故而导致本合同约定的重大疾病，则不受等待期时限的限制。','1'),(6200402,135,'10','意外重疾保险金','在本合同保险期间内，被保险人在等待期#等待期#日后，经中华人民共和国（不包括香港、澳门、台湾地区）二级及以上医院或保险人（释义见6.3）认可的医疗机构确诊初次患有本合同约定的重大疾病（释义见6.4），保险人按照本保险合同载明的保险金额给付重大疾病保险金，同时本保险合同终止。\r\n被保险人在等待期内经确诊初次患有本合同约定的重大疾病，保险人不承担给付保险金的责任，但向投保人无息退还已交纳的保险费，同时本保险合同终止。\r\n若被保险人属于续保或在本保险合同有效期内因遭受意外事故而导致本合同约定的重大疾病，则不受等待期时限的限制。','1'),(6200501,136,'10','重大疾病住院津贴','在本附加合同的保险期间内，被保险人在等待期#等待期#日后，经中华人民共和国（不包括香港、澳门、台湾地区）二级及以上医院或保险人认可的医疗机构确诊初次患有本合同约定的重大疾病，并因此必须住院治疗的，保险人根据保险#每日住院津贴额#的每日住院津贴额，按照被保险人的实际住院日数给付住院津贴，但累计给付日数以#累计给付日数#合同约定的日数为限。\r\n被保险人在等待期内经确诊初次患有本合同约定的重大疾病，保险人不给付住院津贴，但向投保人无息退还已交纳的保险费，同时本保险合同终止。\r\n若被保险人属于续保或在本保险合同有效期内因遭受意外事故而导致本合同约定的重大疾病，并因该重大疾病必须住院治疗的，则不受等待期时限的限制。\r\n          若该被保险人投保了由保险人承保的多种保险产品，如在不同保障产品中有相同保险利益的，则保险人仅按其中保险金额最高者进行给付。','1'),(6200502,136,'10','意外重疾住院津贴','在本附加合同的保险期间内，被保险人在等待期#等待期#日后，经中华人民共和国（不包括香港、澳门、台湾地区）二级及以上医院或保险人认可的医疗机构确诊初次患有本合同约定的重大疾病，并因此必须住院治疗的，保险人根据保险#每日住院津贴额#的每日住院津贴额，按照被保险人的实际住院日数给付住院津贴，但累计给付日数以#累计给付日数#合同约定的日数为限。\r\n被保险人在等待期内经确诊初次患有本合同约定的重大疾病，保险人不给付住院津贴，但向投保人无息退还已交纳的保险费，同时本保险合同终止。\r\n若被保险人属于续保或在本保险合同有效期内因遭受意外事故而导致本合同约定的重大疾病，并因该重大疾病必须住院治疗的，则不受等待期时限的限制。\r\n          若该被保险人投保了由保险人承保的多种保险产品，如在不同保障产品中有相同保险利益的，则保险人仅按其中保险金额最高者进行给付。','1'),(6200601,137,'0','疾病门急诊医疗保险金','您为被保险人首次投保本保险或者非连续投保本保险时，自本合同生效之日起#等待期#日为等待期；您为被保险人不间断连续投保本保险的续保合同无等待期。\r\n被保险人因遭受意外伤害（见 7.3）事故发生门诊或者急诊的，保险责任无等待 期。\r\n在等待期内，被保险人非因意外伤害事故发生门诊或者急诊的，我们不承担给付 保险金的责任。\r\n本合同所述的门诊或者急诊分为以下三种情形：\r\n（1） 因意外伤害事故于二级及以上医院（见 7.4）接受门诊或者急诊治疗；\r\n（2） 因疾病于二级及以上医院接受急诊治疗；\r\n（3） 因疾病于定点医院（见 7.5）接受门诊治疗。\r\n若被保险人因上述三种情形之一从而发生属于本合同约定范围内的门诊或者急诊 医疗费用（以下简称“门急诊医疗费用”），且发生的单次（见 7.6）门急诊医\r\n疗费用金额超过 100 元时，我们承担如下保险责任：\r\n（1） 若被保险人未从社会基本医疗保险、公费医疗、新型农村合作医疗、商业 性门急诊费用补偿型医疗保险、其他政府机构或者社会福利机构获得门诊 或者急诊医疗费用补偿，我们按如下公式给付门急诊医疗保险金：\r\n门急诊医疗保险金＝（门急诊医疗费用－#次免赔额#）×#未从其它途径获得补偿的赔付比例#\r\n（2） 若被保险人已从社会基本医疗保险、公费医疗、新型农村合作医疗、商业 性门急诊费用补偿型医疗保险、其他政府机构或者社会福利机构获得门诊 或者急诊医疗费用补偿（以下简称“已获得的门急诊费用补偿”），我们按 如下公式给付门急诊医疗保险金：\r\n门急诊医疗保险金＝（门急诊医疗费用－已获得的门急诊费用补偿－#次免赔额#） ×#已从其它途径获得补偿的赔付比例#\r\n本合同所约定的门诊或者急诊医疗费用是符合当地（见 7.7）社会基本医疗保险 规定支付范围内的医疗费用。\r\n我们按本合同约定累计给付的门急诊医疗保险金数额之和以本合同的保险金额为 限。','1'),(6200602,137,'0','意外门急诊医疗保险金','您为被保险人首次投保本保险或者非连续投保本保险时，自本合同生效之日起#等待期#日为等待期；您为被保险人不间断连续投保本保险的续保合同无等待期。\r\n被保险人因遭受意外伤害（见 7.3）事故发生门诊或者急诊的，保险责任无等待 期。\r\n在等待期内，被保险人非因意外伤害事故发生门诊或者急诊的，我们不承担给付 保险金的责任。\r\n本合同所述的门诊或者急诊分为以下三种情形：\r\n（1） 因意外伤害事故于二级及以上医院（见 7.4）接受门诊或者急诊治疗；\r\n（2） 因疾病于二级及以上医院接受急诊治疗；\r\n（3） 因疾病于定点医院（见 7.5）接受门诊治疗。\r\n若被保险人因上述三种情形之一从而发生属于本合同约定范围内的门诊或者急诊 医疗费用（以下简称“门急诊医疗费用”），且发生的单次（见 7.6）门急诊医\r\n疗费用金额超过 100 元时，我们承担如下保险责任：\r\n（1） 若被保险人未从社会基本医疗保险、公费医疗、新型农村合作医疗、商业 性门急诊费用补偿型医疗保险、其他政府机构或者社会福利机构获得门诊 或者急诊医疗费用补偿，我们按如下公式给付门急诊医疗保险金：\r\n门急诊医疗保险金＝（门急诊医疗费用－#次免赔额#）×#未从其它途径获得补偿的赔付比例#\r\n（2） 若被保险人已从社会基本医疗保险、公费医疗、新型农村合作医疗、商业 性门急诊费用补偿型医疗保险、其他政府机构或者社会福利机构获得门诊 或者急诊医疗费用补偿（以下简称“已获得的门急诊费用补偿”），我们按 如下公式给付门急诊医疗保险金：\r\n门急诊医疗保险金＝（门急诊医疗费用－已获得的门急诊费用补偿－#次免赔额#） ×#已从其它途径获得补偿的赔付比例#\r\n本合同所约定的门诊或者急诊医疗费用是符合当地（见 7.7）社会基本医疗保险 规定支付范围内的医疗费用。\r\n我们按本合同约定累计给付的门急诊医疗保险金数额之和以本合同的保险金额为 限。','1'),(6200701,138,'1','疾病住院津贴','您为被保险人首次投保本保险或者非连续投保本保险时，自本合同生效日起#等待期#日为等待期；本合同若曾复效，则自本合同最后复效之日起90日为等待期；您为 被保险人不间断连续投保本保险的续保合同无等待期。\r\n被保险人因意外伤害（见 8.4）发生住院（见 8.5）的，保险责任无等待期。\r\n在等待期内，被保险人非因意外伤害发生住院，我们不承担保险金给付责任。被 保险人在等待期内非因意外伤害发生的住院及与该住院视为同一次住院（见 8.6） 的治疗，无论是否延续至等待期后，我们均不承担给付保险金的责任。\r\n保险责任 在本合同保险期间内，我们承担下列保险责任：\r\n若被保险人因意外伤害经诊断必须住院治疗，我们按被保险人在二级及以上医院 （见 8.7）的实际住院天数和本合同约定的住院日额向被保险人给付住院津贴保 险金；若被保险人在等待期后非因意外伤害经诊断必须住院治疗，我们按被保险 人在定点医院（见 8.8）的实际住院天数和本合同约定的住院日额向被保险人给 付住院津贴保险金，即：\r\n被保险人每次住院获得的保险金 ＝ 实际住院天数 × 住院日额（#每日住院津贴#）。\r\n若被保险人住院治疗，且在本合同期满日治疗仍未结束的，对于被保险人该次住 院延续至本合同期满日次日起 30 日内的住院，我们仍在本合同约定的给付天数 范围内承担保险金给付责任，对于被保险人该次住院延续至本合同期满日次日起 30 日后的住院，我们不再承担给付保险金的责任。\r\n被保险人在本合同有效期内累计住院给付天数满#累计住院给付天数# 日，本合同终止。\r\n被保险人因意外伤害（见 8.4）发生住院（见 8.5）的，保险责任无等待期。\r\n在等待期内，被保险人非因意外伤害发生住院，我们不承担保险金给付责任。被 保险人在等待期内非因意外伤害发生的住院及与该住院视为同一次住院（见 8.6） 的治疗，无论是否延续至等待期后，我们均不承担给付保险金的责任。\r\n保险责任 在本合同保险期间内，我们承担下列保险责任：\r\n若被保险人因意外伤害经诊断必须住院治疗，我们按被保险人在二级及以上医院 （见 8.7）的实际住院天数和本合同约定的住院日额向被保险人给付住院津贴保 险金；若被保险人在等待期后非因意外伤害经诊断必须住院治疗，我们按被保险 人在定点医院（见 8.8）的实际住院天数和本合同约定的住院日额向被保险人给 付住院津贴保险金，即：\r\n被保险人每次住院获得的保险金 ＝ 实际住院天数 × 住院日额\r\n若被保险人住院治疗，且在本合同期满日治疗仍未结束的，对于被保险人该次住 院延续至本合同期满日次日起 30 日内的住院，我们仍在本合同约定的给付天数 范围内承担保险金给付责任，对于被保险人该次住院延续至本合同期满日次日起 30 日后的住院，我们不再承担给付保险金的责任。\r\n被保险人在本合同有效期内累计住院给付天数满#累计住院给付天数# 日，本合同终止。','1'),(6200702,138,'1','意外住院津贴','若被保险人因意外伤害经诊断必须住院治疗，我们按被保险人在二级及以上医院 （见 8.7）的实际住院天数和本合同约定的住院日额向被保险人给付住院津贴保 险金；若被保险人在等待期后非因意外伤害经诊断必须住院治疗，我们按被保险 人在定点医院（见 8.8）的实际住院天数和本合同约定的住院日额向被保险人给 付住院津贴保险金，即：\r\n被保险人每次住院获得的保险金 ＝ 实际住院天数 × 住院日额（#每日住院津贴#）。\r\n若被保险人住院治疗，且在本合同期满日治疗仍未结束的，对于被保险人该次住 院延续至本合同期满日次日起 30 日内的住院，我们仍在本合同约定的给付天数 范围内承担保险金给付责任，对于被保险人该次住院延续至本合同期满日次日起 30 日后的住院，我们不再承担给付保险金的责任。\r\n被保险人在本合同有效期内累计住院给付天数满#累计住院给付天数# 日，本合同终止。\r\n被保险人每次住院获得的保险金 ＝ 实际住院天数 × 住院日额\r\n若被保险人住院治疗，且在本合同期满日治疗仍未结束的，对于被保险人该次住 院延续至本合同期满日次日起 30 日内的住院，我们仍在本合同约定的给付天数 范围内承担保险金给付责任，对于被保险人该次住院延续至本合同期满日次日起 30 日后的住院，我们不再承担给付保险金的责任。\r\n被保险人在本合同有效期内累计住院给付天数满#累计住院给付天数# 日，本合同终止。','1'),(6200801,139,'1','重症监护室床位费和监护费','在本合同保险期间内，被保险人因意外伤害（释义二）事故或疾病（释义三）在中华人民共和国境内（不含港、澳、台地区）二级及以上医院（释义四），或保险人认可的医院（不含特需病房、外宾病房或其它不属于社会医疗保险范畴的高等级病房）住院（释义五）治疗的，保险人对于被保险人需个人支付的、必需且合理的住院医疗费用（释义六），在扣除#免赔额#免赔额（释义七）后，依照约定的比例#给付比例#给付住院医疗保险金。住院医疗费用包括床位费（释义八）、膳食费（释义九）、护理费（释义十）、重症监护室床位费、诊疗费、检查检验费（释义十一）、治疗费（释义十二）、药品费（释义十三）、手术费（释义十四）。\r\n各项住院医疗费用以本合同约定的限额为限。\r\n重症监护室床位费和监护费赔偿限额以#重症监护室床位费和监护费赔偿限额#为限，每个保险期间内的最大给付天数以#最大给付天数#为限。','1'),(6200802,139,'7','诊疗费','在本合同保险期间内，被保险人因意外伤害（释义二）事故或疾病（释义三）在中华人民共和国境内（不含港、澳、台地区）二级及以上医院（释义四），或保险人认可的医院（不含特需病房、外宾病房或其它不属于社会医疗保险范畴的高等级病房）住院（释义五）治疗的，保险人对于被保险人需个人支付的、必需且合理的住院医疗费用（释义六），在扣除#免赔额#免赔额（释义七）后，依照约定的比例#给付比例#给付住院医疗保险金。住院医疗费用包括床位费（释义八）、膳食费（释义九）、护理费（释义十）、重症监护室床位费、诊疗费、检查检验费（释义十一）、治疗费（释义十二）、药品费（释义十三）、手术费（释义十四）。\r\n各项住院医疗费用以本合同约定的限额为限。','1'),(6200803,139,'7','检查、检验费、治疗费','在本合同保险期间内，被保险人因意外伤害（释义二）事故或疾