伤害后的#意外伤害发生之日起#天内，需接受本合同所定义的意外面部整形手术（见7.5）时，此项保险责任无等待期。\r\n在等待期后，被保险人确诊罹患合同所定义的乳腺癌，按保险金额给付乳腺癌保险金，合同终止。若在给付乳腺癌保险金前，保险人已依合同向被保险人给付过女性特定妇科癌症保险金、系统性红斑狼疮性肾炎保险金、女性原位癌保险金或意外面部整形手术保险金，则在给付乳腺癌保险金时，需扣除已给付的前述各项保险金。\r\n在等待期后，经医院初次确诊，被保险人罹患合同所定义的女性特定妇科癌症，将按合同保险金额的#赔付比例#给付女性特定妇科癌症保险金，此项保险责任终止。','1'),(6200903,140,'10','系统性红斑狼疮性肾炎保险金','投保人首次为被保险人投保本保险或非连续投保本保险时，自本合同生效日起#等待期#日内，经医院（见7.2）初次确诊（见7.3）被保险人罹患本合同所定义的任何一种或多种疾病，我们按您已交的本合同的保险费数额向本合同保险金受益人给付保险金，本合同终止。这90日称为保险责任等待期。 投保人连续为同一被保险人投保本保险的续保合同无等待期。 被保险人因意外伤害（见7.4）或暴力袭击导致面部毁损，在意外伤害后的#意外伤害发生之日起#天内，需接受本合同所定义的意外面部整形手术（见7.5）时，此项保险责任无等待期。\r\n在等待期后，被保险人确诊罹患合同所定义的乳腺癌，按保险金额给付乳腺癌保险金，合同终止。若在给付乳腺癌保险金前，保险人已依合同向被保险人给付过女性特定妇科癌症保险金、系统性红斑狼疮性肾炎保险金、女性原位癌保险金或意外面部整形手术保险金，则在给付乳腺癌保险金时，需扣除已给付的前述各项保险金。\r\n在等待期后，经医院初次确诊，被保险人罹患合同所定义的女性特定妇科癌症，将按合同保险金额的#赔付比例#给付女性特定妇科癌症保险金，此项保险责任终止。\r\n在等待期后，经医院初次确诊，被保险人罹患合同所定义的系统性红斑狼疮性肾炎，将按合同保险金额的#赔付比例#给付系统性红斑狼疮性肾炎保险金，此项保险责任终止。','1'),(6200904,140,'10','女性原位癌保险金','投保人首次为被保险人投保本保险或非连续投保本保险时，自本合同生效日起#等待期#日内，经医院（见7.2）初次确诊（见7.3）被保险人罹患本合同所定义的任何一种或多种疾病，我们按您已交的本合同的保险费数额向本合同保险金受益人给付保险金，本合同终止。这90日称为保险责任等待期。 投保人连续为同一被保险人投保本保险的续保合同无等待期。 被保险人因意外伤害（见7.4）或暴力袭击导致面部毁损，在意外伤害后的#意外伤害发生之日起#天内，需接受本合同所定义的意外面部整形手术（见7.5）时，此项保险责任无等待期。\r\n在等待期后，被保险人确诊罹患合同所定义的乳腺癌，按保险金额给付乳腺癌保险金，合同终止。若在给付乳腺癌保险金前，保险人已依合同向被保险人给付过女性特定妇科癌症保险金、系统性红斑狼疮性肾炎保险金、女性原位癌保险金或意外面部整形手术保险金，则在给付乳腺癌保险金时，需扣除已给付的前述各项保险金。\r\n在等待期后，经医院初次确诊，被保险人罹患合同所定义的女性特定妇科癌症，将按合同保险金额的#赔付比例#给付女性特定妇科癌症保险金，此项保险责任终止。\r\n在等待期后，经医院初次确诊，被保险人罹患合同所定义的系统性红斑狼疮性肾炎，将按合同保险金额的#赔付比例#给付系统性红斑狼疮性肾炎保险金，此项保险责任终止。\r\n在等待期后，经医院初次确诊，被保险人罹患合同所定义的女性原位癌，将按合同保险金额的#赔付比例#给付女性原位癌保险金，此项保险责任终止。','1'),(6200905,140,'10','意外面部整形手术保险金','被保险人因意外伤害导致面部毁损，在该意外伤害发生后的180日内，需接受合同所定义的意外面部整形手术治疗，在不超过合同保险金额的#赔付比例#限额内，将按照被保险人已经支出的手术费用金额向被保险人给付意外面部整形手术保险金，此项保险责任终止。','1'),(6300101,141,'8','意外伤害身故','被保险人在境外旅行期间遭受意外伤害，并自意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害身故的，保险人按#档次保险金额#给付身故保险金，对该被保险人的保险责任终止。\r\n被保险人因遭受意外伤害且自该意外伤害发生日起下落不明，后经人民法院宣告死亡的，保险人按保险金额给付身故保险金。但若被保险人被宣告死亡后生还的，\r\n保险金受领人应于知道或应当知道被保险人生还后30日内退还保险人给付的身故保险金。\r\n被保险人身故或被宣告死亡前保险人已给付约定的残疾保险金的，身故保险金应扣除已给付的保险金。','1'),(6300102,141,'9','意外伤残保险金','被保险人在境外旅行期间遭受意外伤害，并自该意外伤害发生之日起#意外伤害发生之日起#日内因该意外伤害造成本保险合同所附《人身保险伤残评定标准》（简称《评定标准》）所列残疾程度之一的，保险人按《评定标准》所对应伤残等级的给付比例乘以本保险合同上所载的意外伤害保险金额#档次保险金额#给付残疾保险金。如第180日治疗仍未结束的，按当日的身体情况进行伤残评定，并据此给付残疾保险金。\r\n（1）被保险人因同一意外伤害造成两处或两处以上伤残时，保险人根据《评定标准》规定的多处伤残评定原则给付残疾保险金。\r\n（2）被保险人如在本次意外伤害之前已有残疾，保险人按合并后的残疾程度在《评定标准》中所对应伤残等级的给付比例扣除原有残疾程度在《评定标准》中所对应伤残等级的给付比例，给付残疾保险金。','1'),(6300103,141,'0','医疗费用补偿','在本附加险合同的保险期间内，被保险人在旅行期间，遭受意外伤害事故或罹患疾病，前往所在国家或地区的医疗机构进行治疗的，保险人按照本附加险合同的约定进行赔偿：\r\n（1）自意外伤害事故或疾病发生之日起#事故发生之日起#天内，对于被保险人因此实际支出的，必需且合理的医疗费用，保险人在扣除免赔额后，按照赔付比例给付医疗保险金。免赔额和给付比例由投保人和保险人在投保时约定，并在保险合同中载明；\r\n（2）若被保险人在境外遭遇意外伤害事故或罹患疾病，返回中国境内需要继续治疗的，对于其返回境内日常居住地后三十日内（但最迟不超过意外伤害事故或罹患突发性疾病发生之日起九十日），因该意外伤害或该疾病需继续接受后续治疗的，保险人对被保险人在境内医疗机构实际支出的必需且合理的医疗费用，保险人亦予以给付，但该后续治疗费用给付金额以本合同所载保险金额#档次保险金额#的10%为限；\r\n（3）本附加险合同为费用补偿型保险合同，适用医疗费用补偿原则。若被保险人还可从其它保险计划（包括农村合作医疗保险、社会基本医疗保险、工作单位、或其他任何商业保险机构等）获得医疗费用补偿，保险人对被保险人获得补偿后的医疗费用的余额按照本合同约定给付保险金；\r\n（4）保险人所负给付医疗保险金的责任以本附加险合同项下的保险金额为限，对被保险人一次或者累计给付保险金达到本附加险合同项下该被保险人的保险金额时，保险人对该被保险人的本附加险合同项下的保险责任终止。\r\n救援机构根据被保险人的身体状况或治疗需要，并参考医生建议，有权决定运送或送返手段和运送目的地。运送和送返的手段包括配备专业医生、护士和必要的运输工具。运输工具可能包括空中救护机、救护车、普通民航班机、火车或其他适合的运输工具。\r\n运送和运返费用包括救援机构安排的运输、运输途中医疗护理及医疗设备和用品之费用。运送和运返所需的费用经保险人核实确认后直接支付给救援机构，费用总数最高以本附加合同项下的保险金额#档次保险金额#为限。倘若实际费用超越该保险金额，则超出部分的费用由被保险人负责支付。\r\n任何未经救援机构批准并安排的费用，保险人不负责赔偿；倘若在紧急医疗情况下，该被保险人由于不可抗力原因无法通知救援机构，保险人将有权根据投保人所选择的保险计划，以及在相同情况下由救援机构提供或安排服务所需要的合理的费用进行赔偿。\r\n若该被保险人为同一旅程自愿投保由保险人承保的多种保险产品，如在不同保障产品中有相同保险利益的，则保险人仅按其中保险金额最高者给予赔偿。','1'),(6300104,141,'7','旅行紧急医疗运送和送返保险金','在本附加合同的保险期间内，被保险人在旅行期间遭受意外伤害事故或罹患突发性疾病，经保险人委托的救援服务机构或其授权代表（以下简称“救援机构”）从医疗角度认为被保险人有运送必要的，则将该被保险人送至当地或其就近地区符合治疗条件的医院。经救援机构从医疗角度认定为有送返必要的，则将被保险人送返至其在中国大陆境内的住所地或经常居住地。\r\n救援机构根据被保险人的身体状况或治疗需要，并参考医生建议，有权决定运送或送返手段和运送目的地。运送和送返的手段包括配备专业医生、护士和必要的运输工具。运输工具可能包括空中救护机、救护车、普通民航班机、火车或其他适合的运输工具。\r\n运送和运返费用包括救援机构安排的运输、运输途中医疗护理及医疗设备和用品之费用。运送和运返所需的费用经保险人核实确认后直接支付给救援机构，费用总数最高以本附加合同项下的保险金额#档次保险金额#为限。倘若实际费用超越该保险金额，则超出部分的费用由被保险人负责支付。\r\n任何未经救援机构批准并安排的费用，保险人不负责赔偿；倘若在紧急医疗情况下，该被保险人由于不可抗力原因无法通知救援机构，保险人将有权根据投保人所选择的保险计划，以及在相同情况下由救援机构提供或安排服务所需要的合理的费用进行赔偿。\r\n若该被保险人为同一旅程自愿投保由保险人承保的多种保险产品，如在不同保障产品中有相同保险利益的，则保险人仅按其中保险金额最高者给予赔偿。','1'),(6300105,141,'8','遗体/骨灰送返保险金','经保险人委托的救援服务机构（以下简称救援机构），根据被保险人亲属的要求，在遵守当地法律法规和符合当地实际情况的前提条件下，将该被保险人之遗体或骨灰送返至被保险人的中国大陆境内的住所地或经常居住地。\r\n遗体送返服务所需费用包括尸体防腐、保存、火化、运输及骨灰盒等材料和服务费用，经保险人核实确认后直接支付给救援机构，最高不超过#档次保险金额#。','1'),(6300106,141,'8','丧葬保险金','经保险人委托的救援机构，根据被保险人亲属的要求，在遵守当地法律法规和符合当地实际情况的前提条件下，安排在当地安葬被保险人的，则保险人按实际支出的被保险人之丧葬费用给付丧葬保险金予身故保险金受益人。最高给付金额以本附加合同项下该被保险人相应的丧葬保险金额#档次保险金额#为限。\r\n上述两项保险金的合计最高给付总额以本附加险合同项下的该被保险人保险金额为限。','1'),(6300107,141,'7','旅行慰问探访保险','在本附加险合同保险期间内，若被保险人在旅行期间发生如下情况，保险人以本附加险合同项下该被保险人的保险金额#档次保险金额#为限，给付一张往返于该被保险人所在地与探访者所在地之间的经济舱位机票和/或船票和/或车票，用于该被保险人的一名成年直系亲属前往被保险人所在地：\r\n（1）被保险人因遭受意外伤害或罹患突发性疾病，经所在国家或地区的医疗机构的医生诊断必须住院治疗的，且连续住院十日以上；\r\n（2）被保险人因遭受意外伤害或罹患突发性疾病，并以此为直接且单独原因导致身故。','1'),(6300108,141,'7','未成年人送返费用补偿保险金','在本附加险合同保险期间内，若被保险人在旅行期间，因遭受意外伤害或罹患突发性疾病，且无其他成年旅伴，导致与被保险人随行且被保险人对其负有照管义务的未成年人无人照料，被保险人要求保险人授权的救援服务机构或其授权代表（以下简称“救援机构”）安排其随行未成年人返回中国境内(不含港澳台地区)日常居住地的，保险人按照本合同的约定承担被保险人应当向救援机构支付最多两名未成年人合理必要的送返费用。\r\n送返费用包括该未成年人返回其在中国境内日常居住地所支出的、必需且合理的交通费用，及救援机构安排护送人员随行护送产生的合理费用，上述费用经保险人核实确认后直接支付给救援机构，但最高以本合同项下的保险金额#档次保险金额#为限，超出部分的费用应当由被保险人负责支付。','1'),(6300109,141,'8','突发急性疾病身故','在保险期间内，如被保险人在境外旅行期间因突发急性病，并自发病之日起#事故日起有效期天数#日内（含7日）因该急性病导致身故的，保险人按本附加险合同项下的保险金额给付急性病身故保险金#档次保险金额#，对该被保险人的保险责任终止','1'),(6300801,142,'8','意外身故保险金','被保险人在合同有效期内遭受意外伤害事故，且自意外伤害事故发生之日起#意外伤害事故发生之日起#日内，因该意外事故导致身故，本公司按合同约定的保险金额#意外身故保险金#给付意外身故保险金，同时本合同对该被保险人的保险责任终止。\r\n在给付意外身故保险金前，如该被保险人已领取过意外残疾保险金，本公司将从给付的意外身故保险金中扣除已给付的意外残疾保险金','1'),(6300802,142,'9','意外残疾保险金','被保险人在合同有效期内遭受意外伤害事故，且自意外伤害事故发生之日起#意外伤害事故发生之日起#日内，因该意外事故导致身体残疾，本公司根据《人身保险伤残评定标准》的规定给付意外残疾保险金。被保险人仍需继续接受治疗的，本公司根据被保险人在第一百八十日时的身体状况及本公司指定或认可的鉴定机构对被保险人的鉴定结果，依据《人身保险伤残评定标准》的规定给付意外残疾保险金。\r\n当被保险人因同一意外伤害事故造成两处或两处以上伤残时，本公司首先对各处伤残程度分别进行评定，如果几处伤残等级不同，以最重的伤残等级作为最终的评定结论；如果两处或两处以上伤残等级相同，伤残等级在原评定基础上晋升一级，最高晋升至第一级。\r\n当被保险人因不同意外伤害事故而导致的不同伤残项目，发生在同一身体结构或身体功能时，本公司仅给付其中较高一项的意外伤残保险金；如果后次伤残程度较高，本公司将在后次给付的意外伤残保险金中扣除前次已给付的意外伤残保险金；如果前次伤残程度较高，则本公司不再给付后次的意外伤残保险金。本公司对同一被保险人所负的残疾保险金给付责任最高以本合同约定的保险金额为限，若本公司累计给付的意外残疾保险金达到保险金额时，本合同对该被保险人的保险责任终止。','1'),(6300803,142,'8','急性病身故','被保险人在合同有效期内因突发疾病，并自发作之日起#事故日起有效期天数#日内导致身故，本公司按合同约定的保险金额给付疾病身故保险金#疾病身故保险金#，同时本合同对该被保险人的保险责任终止。','1'),(6300804,142,'0','意外医疗费用','\"被保险人在合同有效期内因遭受意外伤害事故在本公司指定或认可的医疗机构治疗，或在就近医院抢救（被保险人病情稳定后须转入本公司指定或认可的医疗机构<详见释义>治疗），本公司对被保险人自意外伤害事故发生之日起#意外伤害事故发生之日起#日内所支出的合理医疗费用，在扣除#免赔额#元以后按#给付比例#给付意外医疗保险金#意外医疗保险金#。\r\n被保险人不论一次或多次发生意外伤害保险事故并接受治疗，本公司给付的意外医疗保险金累计不超过本合同约定的保险金额。\r\n若因意外伤害所致医疗费用可从其它福利计划或医疗保险计划取得部分或全部补偿，本公司仅负责补偿剩余部分，并以保险金额为限。\r\n被保险人不论一次或多次发生意外伤害保险事故并接受治疗，本公司给付的意外医疗保险金累计不超过本合同约定的保险金额。\r\n若因意外伤害所致医疗费用可从其它福利计划或医疗保险计划取得部分或全部补偿，本公司仅负责补偿剩余部分，并以保险金额为限。','1'),(6300901,143,'8','意外伤害身故','在保险期间内被保险人遭受意外伤害，并自#意外伤害发生之日起#日内因该意外伤害身故的，保险人按保险金额给付#身故保险金#，对该被保险人的保险责任终止。被保险人因遭受意外伤害且自该意外伤害发生日起下落不明，后经人民法院宣告死亡的，保险人按保险金额给付身故保险金。但若被保险人被宣告死亡后生还的，保险金受领人应于知道或应当知道被保险人生还后30日内退还保险人给付的#身故保险金#。被保险人身故前保险人已给付 2.1.2 约定的的，身故保险金应扣除已给付的保险金。   ','1'),(6300902,143,'9','意外伤害残疾保险金','在保险期间内被保险人遭受意外伤害，并自该#意外伤害发生之日起#日内因该意外伤害造成本保险合同所附《人身保险伤残评定标准》（释义见 8.6）（简称《评 定标准》）所列伤残程度之一的，保险人按《评定标准》所对应伤残等级的给付比例乘以保险金额给付#残疾保险金#。如第180日治疗仍未结束的，按当日的身体情况进行伤残评定，并据此给付#残疾保险金#。（1）被保险人因同一意外伤害造成两处或两处以上伤残时，保险人根据《评定标准》规定的多处伤残评定原则给付#残疾保险金#。（2）被保险人如在本次意外伤害之前已有残疾，保险人按合并后的残疾程度在《评定标准》所对应伤残等级的给付比例扣除原有残疾程度在《评定标准》中所对应伤残等级的给付比例，给付残疾保险金。 ','1'),(6300903,143,'0','医疗费用补偿','在保险期间内，如任何被保险人在境内旅行期间遭受意外伤害，并自该#意外伤害发生之日起#天内（含90天）在医疗机构（释义见 4.1） 进行治疗，对于在上述天内发生的必要且合理的医疗费用（释义见 4.2），保险人在扣除免赔额#免赔额#元后，按照赔付比例#赔付比例#给付#医疗保险金#。被保险人通过任何途径所获得的医疗费用补偿金额总和以其实际支出的医疗费用金额为限。被保险人已经从社会基本医疗保险或任何第三方（包括任何商业医疗保险）获得相关医疗费用补偿的，保险人仅对扣除已获得补偿后的剩余医疗费用，按照合同约定承担给付保险金责任。 ','1'),(6300904,143,'7','紧急医疗运送和运返费用补偿','在保险期间内，被保险人在境内旅行期间遭遇意外伤害或罹患疾病, 经保险人委托的救援机构（以下简称“救援机构”）从医疗角度认定为有运送必要的，则将该被保险人运送至当地或其他就近地区符合治疗条件的医院；经救援机构从医疗角度认定为有运返必要，则将该被保险人运返至其合法有效证件所载的住所地。救援机构根据该被保险人身体状况或治疗需要，并参考医生（释义 见 3.1）建议，有权决定运送和运返手段和目的地。运送和运返手段包 括配备专业医生、护士（释义见 3.2）和必要的运输工具。运输工具可 能包括空中救护机、救护车、普通民航班机、火车或其他适合的运输工具。运送和运返费用包括救援机构安排的运输、运输途中医疗护理及医疗设备和用品之费用。运送和运返所需的费用经保险人核实确认后直接支付给救援机构，费用总数最高以保险单上所载的本附加险合同项下该被保险人相应的保险金额#紧急医疗运送和运反费用补偿金#元为限。倘若实际费用超越该保险金额，则超出部分的费用由被保险人负责支付。任何未经救援机构批准并安排的费用，保险人不负责给付；倘若在 紧急医疗情况下，该被保险人由于不可抗力原因无法通知救援机构，保险人将有权根据投保人所选择的保险计划，以及在相同情况下由救援机构提供或安排服务所需要的合理的费用进行给付。','1'),(6300905,143,'7','慰问探访交通费用补偿、津贴给付','在保险期间内，若被保险人在境内旅行期间身故，或者因遭受严重意外伤害或罹患严重疾病（释义见 4.1）需在医疗机构（释义见 4.2）住 院（释义见 4.3）治疗且连续住院十天以上，保险人按本附加险合同的约定给付保险金。保险人对同一事故补偿一张往返于该被保险人所在地与探访者所在地之间的经济舱位机票或船票或车票的票款，用于该被保险人的一名成年亲属（释义见 4.4）前往被保险人所在地，进行探访或照顾该被保险人。保险人将依据保险单所载本附加险合同项下相应金额按日支付每日膳食住宿津贴#每日膳食住宿津贴#，支付天数为该成年亲属到达被保险人所在地之日起至其离开之日止的实际天数，但#最高给付天数#以天为限。 ','1'),(6300906,143,'7','遗体送返保险金、丧葬保险金','在保险期间内，被保险人在境内旅行期间遭受意外伤害或罹患疾病，并以此为直接且单独原因导致被保险人于#事故日后身故天数#天（含天）身故，保险人按本附加险合同的约定给付保险金，两项保险金的给付总额以保险单上所载的本附加险合同项下的保险金额#遗体送返保险金、丧葬保险金#为限。经保险人委托的救援机构（以下简称救援机构），在遵守当地法律法 规和符合当地实际情况的前提条件下，将该被保险人之遗体或骨灰运返至被保险人的合法有效证件所载的住所地。遗体运返服务所需费用包括尸体防腐、保存、火化、运输及骨灰盒 等材料和服务费用，经保险人核实确认后直接支付给救援机构。 保险人按实际支出的被保险人之丧葬费用给付丧葬保险金，受益人为身故保险金受益人。丧葬保险金限额以保险单上所载本附加险合同项下的相应数额为准。   ','1'),(24480128914423849,127,'98','缴费',NULL,'7'),(24480128914423850,129,'98','缴费',NULL,'7'),(24480128914423851,129,'98','缴费',NULL,'7'),(24480128914423852,130,'98','缴费',NULL,'7'),(24480128914423856,132,'98','缴费',NULL,'7'),(24480128914423857,133,'98','缴费',NULL,'7'),(24480128914423858,134,'98','缴费',NULL,'7'),(24480128914423859,134,'98','缴费',NULL,'7'),(24480128914423860,135,'98','缴费',NULL,'7'),(24480128914423861,136,'98','缴费',NULL,'7'),(24480128914423865,126,'98','缴费',NULL,'7'),(24480128914423867,131,'98','缴费',NULL,'7'),(24480128914423870,137,'98','缴费',NULL,'7'),(24480128914423871,138,'98','缴费',NULL,'7'),(24480128914423872,139,'98','缴费',NULL,'7'),(24480128914423873,140,'98','缴费',NULL,'7'),(24480128914423874,141,'98','缴费',NULL,'7'),(24480128914423875,141,'98','缴费',NULL,'7'),(24480128914423876,141,'98','缴费',NULL,'7'),(24480128914423877,142,'98','缴费',NULL,'7'),(24548591112552448,143,'98','缴费',NULL,'7'),(24548591112552449,136,'98','缴费',NULL,'7');
